	/* functions */
	fn.extractIds = function(urlList) {
		var ids = [],
			id;
		urlList.forEach(function(url) {
			if (/^http\:\/{2}media\d\.clubpenguin\.com\/play\/v2\/content\/global\/clothing\/icons\/\d+\.swf(?:\?|#|$)/.test(url)) {
				id = Number(url.match(/\/(\d+)\.swf/)[1]);
				if (ids.indexOf(id) == -1) {
					ids.push(id);
				}
			}
		});
		return ids;
	}
	fn.createTypeGallery = function(galleries, typeObj, typeId, title) {
		if (typeObj.hasOwnProperty(typeId)) {
			galleries.push("==" + title + "==\n<gallery widths=\"96\">\n" + typeObj[typeId].join("\n") + "\n</gallery>");
		}
	}
	fn.createGalleries = function(ids) {
		console.log(ids);
		var bGT = {}, // for "byGalleryType", not an lgbt reference lol
			count = {},
			total = 0;
			wt = [];
		/* sorting part */
		// sort items by ascending order
		ids.sort(function(a, b) {
			return a - b;
		});
		// go through ids and add item to respective type gallery
		ids.forEach(function(id) {
			if (allitems.hasOwnProperty(id)) {
				var item = allitems[id],
					type = item.type,
					title = item.title,
					name = item.name;
				bGT[type] = bGT[type] || [];
				bGT[type].push(item.file + "|[[" + title + (title != name ? "|" + item.name : "") + "]] (ID " + id + ")");
				// provide an item count, if desired
				count[type] = count[type] || 0;
				count[type]++;
				total++;
			} else {
				console.error("'console.error' called. u know why? cause there's no such clothing id as " + id + ". get dat, buttface? so pls stop opening files that don't exist like '3141592653.swf', this isn't the 15th century. and, seriously, haven't you just been asked by a text on your screen to CLEAR your cache? get a life lol you're probably almost 30 and you still care for your penguin items and yomama still gives you pocket money for cj trading cards. all i have left is feel sorry for you... and for me- thanks disney for closing cp before i stumble into a similar condition");
			}
		});
		/* constructing galleries */
		// head items
		fn.createTypeGallery(wt, bGT, 2, "Head Items");
		// face items
		fn.createTypeGallery(wt, bGT, 3, "Face Items");
		// neck items
		fn.createTypeGallery(wt, bGT, 4, "Neck Items");
		// hand items
		fn.createTypeGallery(wt, bGT, 6, "Hand Items");
		// body items
		fn.createTypeGallery(wt, bGT, 5, "Body Items");
		// feet items
		fn.createTypeGallery(wt, bGT, 7, "Feet Items");
		// pins
		fn.createTypeGallery(wt, bGT, 8, "Flags and Pins");
		// backgrounds
		fn.createTypeGallery(wt, bGT, 9, "Backgrounds");
		// colors
		fn.createTypeGallery(wt, bGT, 1, "Colors");
		// awards
		fn.createTypeGallery(wt, bGT, 10, "Awards");
		/* now merge content and output */
		// add count table
		wt.unshift(
			'==Item count==\n' +
			'{| class="wikitable"\n' +
			'! Type !! Amount\n' +
			'|-\n' +
			'| Head || ' + (Array.isArray(bGT[2]) ? bGT[2].length : 0) + '\n' +
			'|-\n' +
			'| Face || ' + (Array.isArray(bGT[3]) ? bGT[3].length : 0) + '\n' +
			'|-\n' +
			'| Neck || ' + (Array.isArray(bGT[4]) ? bGT[4].length : 0) + '\n' +
			'|-\n' +
			'| Hand || ' + (Array.isArray(bGT[6]) ? bGT[6].length : 0) + '\n' +
			'|-\n' +
			'| Body || ' + (Array.isArray(bGT[5]) ? bGT[5].length : 0) + '\n' +
			'|-\n' +
			'| Feet|| ' + (Array.isArray(bGT[7]) ? bGT[7].length : 0) + '\n' +
			'|-\n' +
			'| Flags and Pins || ' + (Array.isArray(bGT[8]) ? bGT[8].length : 0) + '\n' +
			'|-\n' +
			'| Backgrounds || ' + (Array.isArray(bGT[9]) ? bGT[9].length : 0) + '\n' +
			'|-\n' +
			'| Colors || ' + (Array.isArray(bGT[1]) ? bGT[1].length : 0) + '\n' +
			'|-\n' +
			'| Awards || ' + (Array.isArray(bGT[10]) ? bGT[10].length : 0) + '\n' +
			'|-\n' +
			'! total: !! ' + total + '\n' +
			'|}\n'
		);
		// output
		return wt.join("\n\n");
	}
